import React from "react";
import { ContactSection,  } from "./style";

const Contact = () => {
    return (
        <ContactSection>
            <div className="container">
                <ContactTitle><span>Une question, une remarque ? </span>Veuillez me contacter **</ContactTitle>
                    <form action="">
                        <div className="form-input">
                            <input type="text" placeholder="Votre nom" />
                            <input type="email" placeholder="Votre adresse E-mail" />
                        </div>
                            <input type="text" class="sub" placeholder="Votre sujet" />
                            <textarea cols="30" rows="10" placeholder="Votre message ..."></textarea>
                     <input type="submit" value="Envoyer" />
                    </form>
            </div>
        </ContactSection>
);
};

export default Contact;
